import React from 'react';
import QRCode from 'qrcode.react';
import '../static/ticket.css';

export default function Ticket() {
  const ticketData = {
    id: 'CIN32',
    movieTitle: 'Avengers: Endgame',
    cinema: 'Cineplex Cinemas',
    date: '2023-06-10',
    time: '19:30',
    payment: 'Paid',
    seatNumber: 'A1'
  };

  return (
    <div className='ticket'>
    <h2>Ticket</h2>
      <div className="ticket-info">
        <div className="qrcode">
          <QRCode value={JSON.stringify(ticketData)} size={128} />
        </div>
        <div className="details">
          <p>Ticket ID: {ticketData.id}</p>
          <p>Movie Title: {ticketData.movieTitle}</p>
          <p>Cinema: {ticketData.cinema}</p>
          <p>Date: {ticketData.date}</p>
          <p>Time: {ticketData.time}</p>
          <p>Payment: {ticketData.payment}</p>
          <p>Seat Number: {ticketData.seatNumber}</p>
        </div>
      </div>
    </div>
  );
}
